import { Link } from "react-router-dom";
import { Icon } from '@iconify/react';

const SearchBar = () => {
    return (
        <div className="search-bar">
            <form className="" action="/" method="GET">
            <input typeplaceholder="search"/>



            </form>
            <input placeholder="search"/>
            <button>
                <Icon icon="bi:search" />
            </button>
        </div>
    );
};

export default SearchBar;
